         <Switch>
        <Route exact path="/AddNew" component={AddNew}/>
      </Switch>
         </div>
    </div>
        </div>

        <div className = "Poke_field"/>
        {/* <Display /> */}
        </div>

     {/* <AddNew/> */}

    </div>

    </Router> 
  );
}

export default App;

